                    "description": "\ud2b8\uc640\uc774\uc2a4\uc758 \uccab \uc6d4\ub4dc \ud22c\uc5b4 TWICE WORLD TOUR 2019 \u2018TWICELIGHTS\u2019 \ubb34\ub300\ub97c \ud654\ub824\ud558\uac8c \uc7a5\uc2dd\ud55c \ud2b8\uc640\uc774\uc2a4. \uc9c0\uae08\uc758 \ud2b8\uc640\uc774\uc2a4\uac00 \uc788\uae30\uae4c\uc9c0 \uadf8\ub4e4\uc740 \uc65c \ud2b8\uc640\uc774\uc2a4\uac00 \ub418\uace0 \uc2f6\uc5c8\uace0, \uc5b4\ub5bb\uac8c \ud2b8\uc640\uc774\uc2a4\uac00 \ub420 \uc218 \uc788\uc5c8\uc744\uae4c? \ub05d\uc774 \uc5c6\uc5b4 \ubcf4\uc774\ub358 \uae38\uc5d0\uc11c \uc55e\ub9cc \ubcf4\uace0 \ub2ec\ub838\ub358 \uadf8 \uc2dc\uc808, \uadf8\ub4e4\uc758 \uc5f0\uc2b5\uc0dd \uc774\uc57c\uae30\ubd80\ud130 \ubb34\ub300 \ub4a4 \uc5c4\uccad\ub09c \ubd80\ub2f4\uac10\uacfc \ucee8\ub514\uc158 \uc545\ud654 \uc18d\uc5d0\uc11c \ubc1c\uc0dd\ud55c \uc608\uc0c1\uce58 \ubabb\ud55c \uc77c\ub4e4\uae4c\uc9c0. \ud558\uc9c0\ub9cc \uc774 \ubaa8\ub4e0 \uac83\uc744 \ud568\uaed8\ud55c \uc544\ud649\uba85\uc740 \uc11c\ub85c \uc190\uc744 \ub9de\uc7a1\uace0 \uac19\uc740 \uafc8\uc744 \ud5a5\ud574 \ud55c \uac78\uc74c \ud55c \uac78\uc74c \ub098\uc544\uac04\ub2e4. \ubb34\ub300 \ub4a4 \uadf8\ub4e4\uc758 \uce58\uc5f4\ud55c \uc131\uc7a5 \uacfc\uc815\ubd80\ud130 \ubaa8\ub4e0 \uac83\uc744 \uc3df\uc544 \ubd80\uc5c8\ub358 \uc5f0\uc2b5\uc0dd \uc2dc\uc808\uc758 \uc774\uc57c\uae30\uae4c\uc9c0- \uc5b4\ub514\uc5d0\uc11c\ub3c4 \ubcfc \uc218 \uc5c6\uc5c8\ub358 \ud2b8\uc640\uc774\uc2a4\uc758 \ubaa8\ub4e0 \uac83! \ud2b8\uc640\uc774\uc2a4\uc758 \uc2dc\uc791, \ud604\uc7ac, \uadf8\ub9ac\uace0 \ubbf8\ub798\uc5d0 \ub300\ud574 \uc774\uc57c\uae30\ud558\ub294 \ub9ac\uc5bc \ud2b8\uc640\uc774\uc2a4 \ub2e4\ud050\uba58\ud130\ub9ac.",
