        "title": "17320\ud68c. \uc591\uce21 \ubaa8\ub450 \ubcc0\ud638\uc0ac\ub2d8\uaed8\uc11c \ud310\ub2e8\ud574\uc8fc\uc2dc\ub294\ub300\ub85c \uacfc\uc2e4 \uc778\uc815 \ud558\uae30\ub85c \ud588\uc2b5\ub2c8\ub2e4",
        "description": "DB\uc190\ud574\ubcf4\ud5d8 \ud55c\ubb38\ucca0\uc758 \ucd08\uae30\ub300\uc751\ud50c\ub79c\n\uc804\ud654\uc0c1\ub2f4\uc2e0\uccad 1644-0070\n\uc628\ub77c\uc778\uc0c1\ub2f4\uc2e0\uccad http://m.site.naver.com/11FYh\n\uc900\ubc95\uac10\uc2dc\uc778\ud655\uc778\ud544 \uc81c2022-4859\ud638(2022.09.29)\n\n39582 \n221024 \uc6d4 \uc624\ud6c4 \uc0dd\ubc29\uc1a1\n\uace8\ubaa9\uae38\uc5d0\uc11c \ub098\uac00\ub824\ub294\ub370 \uc778\ub3c4\ub85c \uc5ed\uc8fc\ud589\ud55c \uc804\uae30\uc790\uc804\uac70\uc640 \uc0ac\uace0\nL,\n\n\n\uc591\uce21 \ubcf4\ud5d8\uc0ac, \uc790\uc804\uac70, \ucc28\ub7c9 \ub3d9\uc758 \ud558\uc5d0 \uc9c8\ubb38\ub4dc\ub9bd\ub2c8\ub2e4.\n\uc791\uc131\uc790\ub294 \uc5b4\ub514\ucabd\uc778\uc9c0\ub294 \ub9d0\uc500 \ubabb\ub4dc\ub9ac\ub294 \uc810 \uc591\ud574 \ubd80\ud0c1\ub4dc\ub9bd\ub2c8\ub2e4.\n\uac01\uc790\uc758 \uc785\uc7a5\uc744 \ud655\uc778\ud558\uc2dc\uace0 \uacfc\uc2e4 \uc5ec\ubd80\ub97c \ubd80\ud0c1\ub4dc\ub9ac\uaca0\uc2b5\ub2c8\ub2e4.\n\ubcc0\ud638\uc0ac\ub2d8 \uacfc\uc2e4\ub85c \uc11c\ub85c \uc778\uc815\ud558\uae30\ub85c \ud588\uc2b5\ub2c8\ub2e4.\n\ucc28\ub7c9\uc740 \uc774\uba74\ub3c4\ub85c\uc5d0\uc11c \ub098\uc640 \uc6b0\uce21\uc5d0\uc11c \uc88c\uce21\uc73c\ub85c \uc9c4\ud589\ud558\ub294 \uc77c\ubc29\ud1b5\ud589\ub85c \uc88c\ud68c\uc804 \uc9c4\uc785\uc911 \uc804\uae30 \uc790\uc804\uac70\uac00 \ud6a1\ub2e8\ubcf4\ub3c4\ub85c \uc790\uc804\uac70 \ud0d1\uc2b9 \uc9c4\ud589 \ubc0f \ucc28\ub7c9 \ud1b5\ud589 \uc5ed\ubc29\ud5a5 \uc9c4\ud589\uc73c\ub85c \ubc1c\uc0dd\ub41c \uc0ac\uace0\uc785\ub2c8\ub2e4.\n\uc790\uc804\uac70\ub294 \ud6a1\ub2e8\ubcf4\ub3c4 \uc9c4\uc785 \uc804 \uc18d\ub3c4\ub97c \uc904\uc774\uace0 \ucc28\ub7c9\ub3c4 \uc18d\ub3c4\ub97c \uc904\uc774\uc790 \uba48\ucd9c \uc904 \uc54c\uace0 \ud6a1\ub2e8\ud558\ub294 \uc911 \uc0ac\uace0\ubc1c\uc0dd\uc785\ub2c8\ub2e4.\n\nggn****\u00a0 \u00a0 2022-10-22 09:05\n\uc774\uba74\ub3c4\ub85c \ub098\uc640\uc11c \uc88c\uce21\uc73c\ub85c\ub9cc \uac08 \uc218 \uc788\ub294 \uc77c\ubc29\ud1b5\ud589\uae38\uc785\ub2c8\ub2e4.\n\ucc28\ub7c9\uc774 \uc788\ub294 \uc774\uba74\ub3c4\ub85c\ub294 \uc591\ubc29\ud5a5 \uc9c4\ucd9c\uc785\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4.\n\uc0ac\uace0\uac00 \ub09c \ub3c4\ub85c\ub294 \uc778\ub3c4\uc785\ub2c8\ub2e4.\u00a0 \uacb8\uc6a9\ub3c4\ub85c\ub294 \uc544\ub2d9\ub2c8\ub2e4.\n\n* \ud22c\ud45c *\n\n\uc804\uae30 \uc790\uc804\uac70\uac00 \ub354 \uc798\ubabb 10%\n\ube14\ubc15\ucc28\uac00 \ub354 \uc798\ubabb 66%\n50:50  24%\n\n\n\uc778\ub3c4\ub294 \uc790\uc804\uac70\uac00 \ub2e4\ub2d0 \uc218 \uc5c6\ub294 \uc778\ub3c4, \n\uc778\ub3c4\uc5d0 \ubd88\ubc95\uc8fc\ucc28\ub85c \uc2dc\uc57c\uac00 \uac00\ub824\uc9c4 \uc0c1\ud0dc, \uc5b4\ub9b0\uc774\ub098 \ub178\uc778\uc740 \uc778\ub3c4\uc5d0\uc11c \uc790\uc804\uac70\ub97c \ud0c8 \uc218 \uc788\uace0 \uc5b4\ub9b0\uc774\ub098 \ub178\uc778\uc774 \uc790\uc804\uac70\ub97c \ud0c0\uace0 \ub098\uc628\ub2e4\uba74 \ube14\ubc15\ucc28\uc758 \uc798\ubabb\uc774 \ub354 \ud06c\ubbc0\ub85c \ube14\ubc15\ucc28\uac00 \ub354 \uc798\ubabb\uc774\ub77c\ub294 \uc758\uacac, \n\n\n#\ud55c\ubb38\ucca0 #\ud55c\ubb38\ucca0TV #\ube14\ub799\ubc15\uc2a4 #\ube14\ubc15\uc601\uc0c1 #\uad50\ud1b5\uc0ac\uace0 #\uad50\ud1b5\uc0ac\uace0\uc601\uc0c1 #traffic #accident #trafficaccident #car #caraccident #dashcam #blackbox",
