        "description": "(\ud611\ucc2c)\n\n\uc548\ub155\ud558\uc138\uc694! \uc548\ub098\uc785\ub2c8\ub2e4\n\ube0c\ub85c\uc544\uc2e0 \ud654\uc774\ud2b8\ub2dd \ud654\uc7a5\ud488 \ub9ac\ubdf0\uc785\ub2c8\ub2e4\n\n\ud53c\ubd80\uacfc\uc5d0\uc11c \uae30\ubbf8\uc7a1\ud2f0 \uc2dc\uc220 \ubc1b\ub294 \uac83\uc740 \uc77c\uc2dc\uc801\uc778 \ud6a8\uacfc\uc774\uace0\n\ube44\uc2fc \uac00\uaca9\uc774 \ubd80\ub2f4\uc778\ub370\uc694\n\ube0c\ub85c\uc544\uc2e0 \ubbf8\ubc31\ud06c\ub9bc\uc740\n2\uc8fc\ub9cc\uc5d0 \ud6a8\uacfc\uac00 \ub098\ud0c0\ub098\ub294 \uac00\uc131\ube44 \uc88b\uc740 \ubbf8\ubc31\ud06c\ub9bc \ud654\uc7a5\ud488\uc774\uc5d0\uc694\n\n2\uc8fc\ub9cc\uc5d0 1.02% \uac1c\uc120 \uc784\uc0c1\uc2dc\ud5d8 \uc644\ub8cc\ub41c \uc81c\ud488\uc774\ub77c \ubbff\uace0 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc5b4\uc694\n\uc800\ub294 \uc218\ubd84\ud06c\ub9bc \ub300\uc2e0\uc5d0 \ud1a0\ub108-\ub85c\uc158-\ub2e4\uc74c\ub2e8\uacc4\uc5d0 \uc0ac\uc6a9 \uc911\uc785\ub2c8\ub2e4\n\n\uc7ac\ub8cc\ub97c \uc544\ub07c\uc9c0 \uc54a\uace0 \uc131\ubd84\uc774 \uc88b\uae30\ub85c \uc720\uba85\ud55c '\uc5d0\ud15c'\uc5d0\uc11c \uc81c\uc791\ud588\uad6c\uc694\n\ube0c\ub85c\ucf5c\ub9ac \ucd94\ucd9c\ubb3c, \ubaa8\ub9c1\uac00\ucd94\ucd9c\ubb3c \ucd08\uace0\ud568\ub7c9 \ud568\uc720\ub41c \ud654\uc7a5\ud488\uc785\ub2c8\ub2e4\n\n\uc608\ubbfc\ud558\uace0 \ubbfc\uac10\ud55c \ud53c\ubd80\uc5d0\ub3c4 \uac71\uc815\uc5c6\uc774 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc5b4\uc694\n\ud53c\ubd80\uc800\uc790\uadf9 \ud14c\uc2a4\ud2b8 \uc644\ub8cc\ud588\uac70\ub4e0\uc694 :)\n\uc88b\uc740 \ud654\uc7a5\ud488 \uac19\uc774 \uc4f0\uace0 \uc548\ub098tv \uc548\uc5d0\uc11c \ubaa8\ub450 \uc608\ubed0\uc9c0\uc138\uc694\n\n***\uc778\uc2a4\ud0c0\uadf8\ub7a8\nhttp://www.instargram.com/nanas_anna\n\n***\uba54\uc77c\ubb38\uc758\nprimemin22@naver.com  \n\n***\ud611\ucc2c\ub9c1\ud06c\nhttps://aetem.co.kr/product/detail.html?product_no=44&cate_no=42&display_group=1&cafe_mkt=ue_U_BR221011\n\n#\ubbf8\ubc31 #\ub9ac\ubdf0 #\ud654\uc7a5\ud488",
