        "description": "\"#\uad6c\ub3c5\ucc28\ucd94\ucc9c #\uc218\uc785\uad6c\ub3c5\ucc28 #\uc9c0\ud504\ub808\ub2c8\uac8c\uc774\ub4dc\n\uc548\ub155\ud558\uc138\uc694. \ubbff\ucc28\uc785\ub2c8\ub2e4.\n\u25b62021 \uc9c0\ud504 \ub808\ub2c8\uac8c\uc774\ub4dc 2.4 \ub860\uc9c0\ud29c\ub4dc \uae30\ubcf8\ud615 \ucc28\ub7c9\uc815\ubcf4 \uc0c1\uc138\ubcf4\uae30:\nhttp://api.meetcha.co.kr/mccarinfo/carDetail?carNumber=152\ub77c7069\n\u260e \uad6c\uc785 \ubb38\uc758: 1644-9582\n\n#\uad6c\ub3c5\ucc28\ucd94\ucc9c #\uc218\uc785\uad6c\ub3c5\ucc28 #\uc9c0\ud504\ub808\ub2c8\uac8c\uc774\ub4dc\"\n\u2605\u2605\u2605\ubbff\ucc28\uac00 \ub4dc\ub9ac\ub294 \uc57d\uc18d \u2605\u2605\u2605\n- 100% \uc2e4\ub9e4\ubb3c \ucc28\ub7c9\ud310\ub9e4/\ucd2c\uc601\n- \uc2e0\ub8b0\ub97c \uc8fc\ub294 \uc815\ud655\ud55c \uc0c1\ub2f4/\ud5c8\uc704\ub9e4\ubb3c 0%\n- \uc911\uace0\ucc28 \uc804\uc561\ud560\ubd80\uac00\ub2a5(\uc800\uc2e0\uc6a9\uc790 \uac00\ub2a5)\n\n\ud574\ub2f9 \ucc28\ub7c9\uc758 \uc8fc\ud589\uac70\ub9ac, \uc8fc\uc694\uc635\uc158 \ub4f1 \uae30\ubcf8\uc815\ubcf4\uc640 \n\ub354 \ub2e4\uc591\ud55c \uc2e4\ub9e4\ubb3c \uc911\uace0\ucc28 \uc815\ubcf4\ub294 \uc571\uc744 \ud1b5\ud574 \ud655\uc778\ud574\ubcf4\uc138\uc694~!! \n\uc0dd\uc0dd\ud55c \uc911\uace0\ucc28 \ub77c\uc774\ube0c \uc601\uc0c1\uc744 \uac10\uc0c1\ud558\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n\n\u25b6 \uc571\ub2e4\uc6b4\ub85c\ub4dc\n+ \uc548\ub4dc\ub85c\uc774\ub4dc https://bit.ly/34wdc7I \n+ \uc544\uc774\ud3f0 https://apple.co/3CzAUzt\n\n\u25b6\uad6c\ub3c5\ud558\uae30: https://bit.ly/3oEGnxv\n\n+\ubcf8 \uc601\uc0c1\uc740 10\uc6d4  29\uc77c \ucd2c\uc601\uc601\uc0c1\uc73c\ub85c \uc2dc\uac04\uc774 \uc9c0\ub0a8\uc5d0 \ub530\ub77c \ucc28\ub7c9\uc2dc\uc138 \uc815\ubcf4\uac00 \ubc14\ub014 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n\n++\ub9e4\ub9e4\ub2e8\uc9c0 \ub0b4 \ucc28\ub7c9\ub3c4\ub09c \ubc29\uc9c0\ub97c \uc704\ud574 \ucd2c\uc601\uc2dc \uc55e\ubc88\ud638\ud310\uc744 \ub5bc\uace0 \uc9c4\ud589\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \ub4b7\ubc88\ud638\ud310\uc740 \ud655\uc778\ud558\uc2e4 \uc218 \uc788\uc73c\ub2c8 \ub108\uadf8\ub7ec\uc6b4 \uc591\ud574\ubd80\ud0c1\ub4dc\ub9bd\ub2c8\ub2e4. \uc571\uc5d0\uc11c \ucc28\ub7c9\ubc88\ud638 \ubc0f \ucc28\ub7c9 \uc635\uc158 \uc815\ubcf4\ub97c \ud655\uc778\ud558\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \n\n+++\ubcf8  \uac8c\uc2dc\ubb3c\uc758 \uc800\uc791\uad8c\uc740 \ubbff\ucc28\uc5d0\uac8c \uc788\uace0, \ud5c8\ub77d \uc5c6\uc774 \uc0ac\uc9c4\uacfc \uc601\uc0c1\uc744 \ub3c4\uc6a9\ud558\uc5ec \uc0c1\uc5c5\uc801\uc73c\ub85c \uc0ac\uc6a9\ud558\uc2e4 \uacbd\uc6b0, \ubbfc\ud615\uc0ac\uc0c1\uc758 \ucc45\uc784\uc774 \ubc1c\uc0dd\ud560 \uc218 \uc788\uc74c\uc744 \uc54c\ub824\ub4dc\ub9bd\ub2c8\ub2e4.",
