        "description": "#\uba38\ud50c\ub7ec #\uc7a5\uac11 #\ub9e4\ub4dc\uace0\ud2b8\n\n\ubf40\uc1a1\uc774\ub4e4 !! \ua4b0\u2362\ua4b1 \u0f18*  \n\uc624\ub298\uc740 \uc880 \ud2b9\ubcc4\ud558\uac8c \uc624\ub798\uc624\ub798 \uc4f0\uae30 \uc88b\uc740\n\uba38\ud50c\ub7ec & \uc7a5\uac11 \ub4e4\uace0\uc654\uc5b4\uc694\n\ud655\uc2e4\ud788 \uce90\uc2dc\ubbf8\uc5b4/\uc6b8\uc740 \ube44\uc2fc\ud488\ubaa9\uc774\uc9c0\ub9cc\n\uadf8\ub798\ub3c4 \ud558\ub098\uc0ac\uc11c \uc624\ub798\uc624\ub798 \uc4f0\uba74 \uc88b\uc73c\ub2c8\uae4c\uc694 !!\n\uc2e0\uaddc\ud68c\uc6d0 10%\ud560\uc778 \ucfe0\ud3f0 \uc788\uc73c\ub2c8\uae4c \n\uace0\uac83\ub3c4 \ucc38\uace0\ud558\uc2dc\uad6c\uc694 (\u0e07'\u0300-'\u0301)\u0e07!\n\n\ud83e\udde4\uc7a5\uac11\uc740 \ud560\uc778\uc5bb\uc5b4\uc654\uc5b4\uc694 ! \ud83e\udde4\nhttps://bit.ly/3f85Dg5\n10/30 00:00~11/6 23:59\n-\uacf5\uc2dd \ud648\ud398\uc774\uc9c0 \ud68c\uc6d0\ub9cc \uad6c\ub9e4 \uac00\ub2a5\n-\uacf5\uc2dd \ud648\ud398\uc774\uc9c0 \uac00\uc785\uc2dc \uc9c0\uae09\ub418\ub294 10% \ud560\uc778\ucfe0\ud3f0 \uc911\ubcf5\uc0ac\uc6a9 \ubd88\uac00\n\n\n\u2714\ufe0f\uc124\uba85\ud560\ub54c \uc785\uc740 \uc637 : \uc5b4\ud150\uc158\ub85c\uc6b0 \ud6c4\ub4dc\uc9d1\uc5c5 + \ub7ec\ube0c\uc774\uc988 \ud2f0\uc154\uce20 + \uba5c\ud305\ud53d\uc140 \uc5c5\ub383\uc608\uc815 \ubaa9\uac78\uc774\n\u2714\ufe0f\uac19\uc774 \ucf54\ub514\ud55c \uc81c\ud488\ub4e4 \ubaa8\ub450 \uba5c\ud305\ud53d\uc140 \ud639\uc740 \uc5c5\ub370\uc774\ud2b8 \uc608\uc815\uc81c\ud488\uc785\ub2c8\ub2e4 ! \n\n\n\ud83e\udde3 L o o k 1 \ud83e\udde3\n01:04\nchunky scarf solid\ndusty pink - with item : melting pixel \uc6cc\uba38\ub77c\uc6b4\ub4dc\ub2c8\ud2b8 + \ub808\uc774\uc5b4\ub4dc\ud2f0 + \ud53c\uce58\ud32c\uce20\nlight khaki - with item : \ud30c\ub974\ud2f0\uba58\ud1a0 \ub354\ud50c\ucf54\ud2b8\n02:24\n+ textured touch gloves\nwith item : melting pixel \ubaa8\ud5e4\uc5b4\uc790\ucf13 (\uc5c5\ub383\uc608\uc815)\n\n\n\ud83e\udde3 L o o k 2 \ud83e\udde3\n03:19\nwoven scarf solid\nwith item : melting pixel \uc0c1\uc758 \ud558\uc758 \ubaa8\ub450 \uc5c5\ub383\uc608\uc815 + \ubb34\uc74c\ubc31\n+ colored edge touch glvoes\n\n\n\ud83e\udde3 L o o k 3 \ud83e\udde3\n05:28\nquilting knit scarf\n06:46 \nseamless knit bucket hat\nwith item : \uba5c\ud305\ud53d\uc140 \uc0cc\ub4dc\ubc31\ud329 +\ub098\uc77c\ub860\uce74\uace0\uc2a4\ucee4\ud2b8 + \uc5c5\ub370\uc774\ud2b8 \uc608\uc815 \uac00\ub514\uac74\n\n\n\ud83e\udde3 L o o k 4 \ud83e\udde3\n07:21\nclassic hole scarf\nwith item : \uba5c\ud305\ud53d\uc140 \uc5c5\ub370\uc774\ud2b8 \uc608\uc815 \ub2c8\ud2b8 + \ub4c0\ubca0\uc774\uc9c1\ud2f0 + \ube14\ub7ec\uc26c\ub370\ub2d8\ub871\uc2a4\ucee4\ud2b8\n\n\n\ud83e\udde3\ub0b4 \ucde8\ud5a5 \ub9e4\ub4ed\ubc95 \uc138\uac00\uc9c0\ud83e\udde3\n09:12\n\n\n\n\n\n\uc774\ud0dc\uc6d0 \ucc38\uc0ac\uc5d0 \uc870\uc758\ub97c \ud45c\ud558\uba70\n\ubd80\uc0c1\uc790\ub4e4\uc758 \ube60\ub978\ud68c\ubcf5\uc744 \uae30\uc6d0\ud569\ub2c8\ub2e4\n\uc0bc\uac00 \uace0\uc778\uc758 \uba85\ubcf5\uc744 \ube55\ub2c8\ub2e4\n\n\n\n\uc1a1\uc774 \uc2e0\uccb4 \uc815\ubcf4 (?) : 164 /53\n\n\ud83e\udd8b \uc1a1\uc774\ub9c8\ucf13 melting pixel \uad6c\uacbd\uac00\uae30\n\uc778\uc2a4\ud0c0\uadf8\ub7a8 : https://www.instagram.com/meltingpixel_official/?hl=ko\n\uba5c\ud305\ud53d\uc140\uc740 \uc0c1\uc2dc\uc624\ud508\ubab0\uc774 \uc544\ub2cc \uae30\uac04\uc81c \ub9c8\ucf13\uc785\ub2c8\ub2e4 ! \ud314\ub85c\uc6b0\ud558\uace0 \uc624\ud508\uc18c\uc2dd \ubc1b\uc544\ubcf4\uc138\uc694 ! \n\n\ud83e\udd8b \uc1a1\uc774\uc640 \ud568\uaed8 \ub9cc\ub4dc\ub294 \ucee8\ud150\uce20 ! \uce74\ud398\uc5d0 \ub180\ub7ec\uc624\uc138\uc694 ~\nhttps://cafe.naver.com/meltingpixel\n\n\ud83e\udd8b \ub370\uc77c\ub9ac\ub8e9 \uc778\uc2a4\ud0c0\uadf8\ub7a8 \nhttps://www.instagram.com/song_e_song_e\n\n\ud83e\udd8bcontact \nsongesongecorp@gmail.com or DM\n\n[Video Source Support]\nYoutube channel \"freeticon\" : https://www.youtube.com/c/Freeticon",
